    [],nt"num_tags": 3,nt"name": "back-bay-national-wildlife-refuge-refuge-narrative-report-september-december-1944",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Back Bay NWR
    outlines Refuge accomplishments from September through December of 1944. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, fishing, and violations. Items of interest and N-R forms are attached.",nt"owner_org":
